Durante el proceso de diseño del Museo Anahuacalli, Diego Rivera se inspiró en el famoso arquitecto Frank Lloyd Wright y, sobre todo, en las culturas prehispánicas. De estas últimas, rescataba y valoraba las formas originarias y el respeto de la conformación del paisaje natural. La plaza central del Anahuacalli se ideó como un teatro al aire libre que da acceso a una pinacoteca, a una galería y al propio Museo; mientras, una reserva ecológica circunda este conjunto formando, a su vez, parte esencial del mismo. El sueño de Diego Rivera era crear una Ciudad de las Artes.

